import React from 'react'
import {SiGmail , SiGithub} from 'react-icons/si';
import {IoLogoLinkedin} from 'react-icons/io';
import {FaPhoneSquare} from 'react-icons/fa';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

export default function Contact() {
    return (
        <React.Fragment>
                <div className="container d-flex">
                    <div><a href="#"><SiGmail className="contactImg"/></a>  </div>
                    <div><a href="#"><IoLogoLinkedin className="contactImg"/></a></div>
                    <div><a href="#"><SiGithub className="contactImg"/></a></div>
                    <div><a href="tel:+91-8892646353"><FaPhoneSquare className="contactImg"/></a></div> 
                    <div><a href="#"><SiGmail className="contactImg"/></a>  </div>
                    <div><a href="#"><IoLogoLinkedin className="contactImg"/></a></div>
                    <div><a href="#"><SiGithub className="contactImg"/></a></div>
                    <div><a href="tel:+91-8892646353"><FaPhoneSquare className="contactImg"/></a></div> 
                </div>
        </React.Fragment>
    )
}
